window.bookSummaryJSON = "<p><b>Lately, my life has been a big, fat, hairy midlife crisis. I could really go for a boring day or three.</b></p> <p>Apparently, there’s no rest for the over-forty crowd.</p> <p>Yes, I have fabulous friends.</p> <p>Yes, I have a beautiful baby.</p> <p>Yes, the ghosts are coming back home. </p> <p>Yes, I’m in love with the Grim Reaper.</p> <p>However, that sexy Demon has got some major ’splainin’ to do … like his possible involvement in the shocking kidnapping of my worst and most deadly enemy.</p> <p>With a drag queen and an ice queen as my back up, we’re going to sashay away into the Darkness to find the truth and turn a wrong into a right.</p> <p>Although, I’m learning fast that black and white are often clouded with shades of gray.</p> <p>Whatever. I’m putting on my rose-colored glasses and going for it. I plan to live midlife in peace … not pieces.</p> <p>Good luck to me.</p>"; 
